script: |
  super -f text -I q10095.spq | sort > q10095.out

inputs:
  - name: q10095.spq
    data: |
      SELECT - col0 / - col0 FROM tab1 (FORMAT parquet) cor0 WHERE + 40 * - col1 + col1 NOT BETWEEN - col2 AND NULL;
  - name: tab1

outputs:
  - name: q10095.out
    data: |
      1
      1
      1
